pullsbody:
**Problem:** The Date() API creates a date object with the current UTC time, where as when the same object is passed into moment its converted to the local timezone, so when ever the local time zone has moved to the next day and UTC is behind(or vice-versa), one of the tests fail.

**Fix:** Create date objects using moment instead of the Date() API.

@eperelman please review.

**Problem:** The Date() API creates a date object with the current UTC time, where as when the same object is passed into moment its converted to the local timezone, so when ever the local time zone has moved to the next day and UTC is behind(or vice-versa), one of the tests fail.

**Fix:** Create date objects using moment instead of the Date() API.

@eperelman please review.

This is a POC backend in Django over Python 3 that supports:

* Mozilla hierarchy tree (from @calixteman scrapped data aka `people.json`)
* Bugzilla components with categories & ownership (from @calixteman scrapped data aka `triage_owners.json`)
* an API endpoint provided by **django-rest-framework** under the url `/api/v1/person/<email>`, that gives details about the requested person.

Details provided are:

1. Base data : name / title / email / bugzilla email
2. Manager infos
3. All managed components (directly managed & managed by subordinates)

The tree query is pretty fast as it uses a recursive CTE expression (works on sqlite & postgresql)

Below is a sample output on @sylvestre :

```
$ curl http://127.0.0.1:8000/api/v1/person/sledru@mozilla.com
{
    "id": 1263,
    "name": "Sylvestre Ledru",
    "title": "Multitasker",
    "email": "sledru@mozilla.com",
    "bugzilla_email": "sledru@mozilla.com",
    "manager": {
        "id": 1174,
        "name": "Yan Or",
        "email": "yor@mozilla.com"
    },
    "components": [
        {
            "id": 127,
            "category": {
                "id": 42,
                "name": "External Software Affecting Firefox"
            },
            "name": "Flash (Adobe)",
            "owner": {
                "id": 1269,
                "name": "Marco Castelluccio",
                "email": "mcastelluccio@mozilla.com"
            }
        },
        {
            "id": 128,
            "category": {
                "id": 42,
                "name": "External Software Affecting Firefox"
            },
            "name": "OpenH264",
            "owner": {
                "id": 1269,
                "name": "Marco Castelluccio",
                "email": "mcastelluccio@mozilla.com"
            }
        },
        {
            "id": 129,
            "category": {
                "id": 42,
                "name": "External Software Affecting Firefox"
            },
            "name": "Other",
            "owner": {
                "id": 1269,
                "name": "Marco Castelluccio",
                "email": "mcastelluccio@mozilla.com"
            }
        }
    ]
}
```

